import { Link } from 'react-router-dom';

// Header component that includes the logo and buttons for navigation
const Header = ({ onLoginClick, onBackHomeClick, onSignUpClick}) => (
    <header className="bg-[rgb(21,8,36)] fixed top-2 left-2 right-2 flex justify-between items-center p-4 rounded-b-lg z-10">
        <Link to="/home" onClick={onBackHomeClick} className='flex items-center space-x-4 bg-[#150824] hover:bg-[#a8acb3] transition border-300 p-2 rounded-md'>
            <img src="https://pdf-background-images.s3.us-east-2.amazonaws.com/logo.png" alt="Logo" className="h-10" />
            <span className='text-white font-montserrat text-lg'>Onboarding Tools</span>
        </Link>
        <div className="flex space-x-4">
            <Link to="/home">
                <Button label="Create Account" />
            </Link>
            <button onClick={onLoginClick} className="bg-[#ff5002] text-white font-montserrat font-bold px-5 py-3 rounded-md hover:bg-opacity-100 transition">
                Log In
            </button>
        </div>
    </header>
);

// Reusable Button component for consistent styling
const Button = ({ label }) => (
    <button className="bg-[#ff5002] text-white font-montserrat font-bold px-5 py-3 rounded-md hover:bg-opacity-100 transition">
        {label}
    </button>
);

export default Header;
